import { Route, Routes } from 'react-router';
import './App.css';
import Login from './components/Login/Login'
import NavBar from './'

function App() {
  return (
    <div >
      <Routes>
        <Route
          path="/"
          element={
            <div>
              <NavBar/>



            </div>
          }
        />

        <Route path="/login" element={<Login/>} />

      </Routes> 

    </div>
  );
}

export default App;
